import React, {useState, useEffect} from "react";
import './Home.css';
import {Header, Table, Icon} from "semantic-ui-react";

const Home = () => {
  const [data, setData] = useState([]);

  useEffect(() => {

  }, []);

  useEffect(() => {

  }, [data]);

  return (
    <div className="container">
      <div className="header">
        <Header as='h2'>
          <Icon name='settings' />
          <Header.Content>
            Reports
          </Header.Content>
        </Header>
      </div>
      <div className="table">
        <Table unstackable>
          <Table.Header>
            <Table.Row>
              <Table.HeaderCell>Order ID</Table.HeaderCell>
              <Table.HeaderCell>Region</Table.HeaderCell>
              <Table.HeaderCell>Country</Table.HeaderCell>
              <Table.HeaderCell>Item Type</Table.HeaderCell>
              <Table.HeaderCell>Sales Channel</Table.HeaderCell>
              <Table.HeaderCell>Order Priority</Table.HeaderCell>
              <Table.HeaderCell>Order Date</Table.HeaderCell>
              <Table.HeaderCell>Order ID</Table.HeaderCell>
              <Table.HeaderCell>Ship Data</Table.HeaderCell>
              <Table.HeaderCell>Units Sold</Table.HeaderCell>
              <Table.HeaderCell>Unit Price</Table.HeaderCell>
              <Table.HeaderCell>Unit Cost</Table.HeaderCell>
              <Table.HeaderCell>Total Revenue</Table.HeaderCell>
              <Table.HeaderCell>Total Cost</Table.HeaderCell>
              <Table.HeaderCell>Total Profit</Table.HeaderCell>
            </Table.Row>
          </Table.Header>
          <Table.Body>
            {data.length>0?<h1>No Data</h1>:data}
          </Table.Body>
        </Table>
      </div>
    </div>
  );
}

export default Home;
